import React, { createContext} from 'react'

const Campscontext = createContext();

export function usecamps(){

    return (Campscontext)
    
}

export function Campsprovider({children})
{

    const camps = "its working";

    return(
        <Campscontext.Provider

        value={camps}
        
        >

            {children}

        </Campscontext.Provider>
    )
}
